function spawnAnt(){
	if(isCTA) return
	var newAnt = antsGroup.shift()

	if(newAnt){
		newAnt.visible = true
		new TWEEN.Tween(newAnt.position).to( { x:8 }, 8000).easing(TWEEN.Easing.Linear.None).onComplete(function(){removeAnt(newAnt, false)}).start()
		antsGroupField.push(newAnt)
	}
}

function removeAnt(removedAnt, byPlayer){
	const index = antsGroupField.indexOf(removedAnt)
	if (index > -1) {
	  	antsGroupField.splice(index, 1);
	  	
	  	if(!byPlayer){
	  		antsCount++
	  	}
	  	else{
	  		antsCountP++
	  	}
	  	updateScore()

		removedAnt.visible = false
		removedAnt.position.x = -8;
		removedAnt.progress.value = 1 
		antsGroup.push(removedAnt) 
	}	
}

function createAnts(){
	if(ant){
    	var isLandscape =  window.innerHeight / window.innerWidth  < 1.3 ? true: false;

		for (let i = 0; i < 10; i++) {
		    // Create donut at a random y-position between 10-20
		    var antClone = clone(ant)
		    antClone.progress = {value:1}
		    var pbar = new ProgressBar(antClone.progress);
	    	pbar.position.y = -0.002;
			antClone.add(pbar)
			antClone.scale.set(180, 180, 180);
			antClone.rotation.y = 1.35;
			antClone.rotation.x = 0.5;
			antClone.position.x = -7;
			antClone.position.z = 5
			antClone.visible = false
			if(!isLandscape)
				antClone.position.x = -3.25;

			const hitAction = spriteMixer.ActionSprite( hitTexture.clone(), 4, 4 );
 			const action = spriteMixer.Action(hitAction, 0, 15, 25);

			hitAction.scale.set(0.02,0.02)
			antClone.add( hitAction );

    		antClone.hitAnim = action

			var mixeranty = new THREE.AnimationMixer( antClone );
			mixeranty.clipAction( antClone.animations[0]).play().setLoop(true);
			mixers.push(mixeranty);

		    antsGroup.push(antClone)
			scene.add(antClone)
		}
	}
}

