function render(time) {
	const delta = clock.getDelta()

	mixers.forEach((mixer) => {
	    mixer && mixer.update(delta);
	});

	/*spriteHitMixers.forEach((hitmixers) => {
	    hitmixers && hitmixers.update(delta);
	});*/
	spriteMixer.update(delta);

	plantsGroupField.forEach((myplant) => {
    	antsGroupField.forEach((myant) => {
    		var distance = myplant.position.distanceTo(myant.position);
    		//console.log(distance)
    		if(distance < 2 && myplant.canAttack){
    			myplant.canAttack = false
    			myant.progress.value -= 0.25

    			if(myant && myant.progress.value <= 0 )
    				removeAnt(myant, true)

    			myant.hitAnim.playOnce()
    			myplant.isAttacking = true
    			myplant.attackAnim.play().setLoop(THREE.LoopOnce)
    		}

		}); 
	});

	TWEEN.update();
	renderer.render( scene, camera );



	if((antsCount >= 3 || antsCountP >=3) && !isCTA)
		startCTA()
}
