class ProgressBar extends THREE.Sprite{
  constructor(_progress){
    super();
    this.scale.set(0.005, 0.0008);
    this.material = new THREE.SpriteMaterial({
      onBeforeCompile: shader => {
        shader.uniforms.progress = _progress;
        shader.fragmentShader = `
          #define ss(a, b, c) smoothstep(a, b, c)
          uniform float progress;
          ${shader.fragmentShader}
        `.replace(
          `outgoingLight = diffuseColor.rgb;`,
          `
            vec3 backColor = mix(vec3(2, 0, 0), vec3(0,0,0), progress);
            float pb = step(progress, vUv.x);

            outgoingLight = mix(vec3(0, 0, 0), vec3(0,1,0), progress);
        	outgoingLight = mix(outgoingLight, backColor, pb)  ;
          `
        );
      }
    });
    this.material.defines = {"USE_UV" : ""};
    this.center.set(0.5, 0.5);
  }
}

